import React from "react";
import {Link} from "react-router-dom"

const Navbar = () => {
    return (  
        <nav className="navbar">
            <h1>
                <strong>HASSAN's</strong> Blog
            </h1>
            <div className="links">
            <Link to="/">Home</Link>
            <Link to="/create" >New Post</Link>
            </div>
        </nav>
    );
}

export default Navbar;
